import React from 'react';
import { Link } from 'react-router-dom';
import './Common.css'; // Import the common CSS file

const Home = ({ username }) => {
    return (
        <div className="container">
            <h1>Home</h1>
            <div className="welcome-message">
                <p>Witaj, {username}!</p>
            </div>
            <div className="button-container">
                <Link to="/mieszkaniec" className="button">Mieszkaniec</Link>
                <Link to="/uchwala" className="button">Uchwala</Link>
                <Link to="/harmonogram" className="button">Harmonogram</Link>
                <Link to="/usterka" className="button">Usterka</Link>
                <Link to="/liczniki" className="button">Licznik</Link>
                <Link to="/rozliczenia" className="button">Rozliczenia</Link>
            </div>
        </div>
    );
};

export default Home;
